    /* FUNCTIONS FOR SENDING NEURON_DATA TO SOC */
    
    // NOTE: each write operation takes about 11,500 clk cycles
    // => total time for sending synapse matrix of 1 core = 11,500 * 8 * 256 = 23,552,000 clk cycles ~ 0.236s (100MHz)
    void send_synapse_connection_to_mem(uint8_t core_index) {
        for (int j=0; j< SLICES_PER_CORE; j++) { // 8 slices per core
            uint32_t SLICE_BASE = SYNAP_MATRIX_BASE + (0x1000 * j);
            for (int k=0; k< AXONS_PER_SLICE; k++) { // 256 axons per slice
                write_32_bit_to_mem((volatile uint32_t*)SLICE_BASE, k , cores[core_index].slices[j].synapse_connection[k]);
            }
        }
    }

    send_synapse_connection_to_mem(0);

    

    
